import ButtonGroup from 'react-bootstrap/ButtonGroup';
import Dropdown from 'react-bootstrap/Dropdown';
import DropdownButton from 'react-bootstrap/DropdownButton';



const DropDownButtonSmall = () => {
    var acciones = {
        1: "Ver",
        2: "Editar",
        3: "Eliminar",
    }
    const handleItemClick = (eventKey) => {
        // Aquí puedes realizar las acciones correspondientes según el elemento seleccionado
        console.log(`Elemento seleccionado: ${acciones[eventKey]}`);
    };
    return (
        <>
            <div>
                {[DropdownButton].map((DropdownType, idx) => (
                    <DropdownType
                        as={ButtonGroup}
                        key={idx}
                        id={`dropdown-button-drop-${idx}`}
                        size="sm"
                        variant="secondary"
                        title="Acciones"
                    >

                        {Object.entries(acciones).map(([key, value]) => (
                            <Dropdown.Item key={key} eventKey={key} onClick={() => handleItemClick(key)}>
                                {value}
                            </Dropdown.Item>
                        ))}
                    </DropdownType>
                ))}
            </div>
        </>
    );
}

export default DropDownButtonSmall;
